import { useNavigate } from "react-router-dom";

const OPEN_CURLY = "{";
const CLOSE_CURLY = "}";

function Landing() {
    const navigate = useNavigate();

    const downloadResume = () => {
        fetch('./Nicholas_Le_Resume.pdf').then(response => {
            response.blob().then(blob => {
                // Creating new object of PDF file
                const fileURL = window.URL.createObjectURL(blob);
                // Setting various property values
                let alink = document.createElement('a');
                alink.href = fileURL;
                alink.download = 'Nicholas_Le_Resume.pdf';
                alink.click();
            })
        })
    }

    return (
        <div className="Landing"> 
            <span className="Keyword">public class</span> <span className="Method-Class">NicholasLe()</span> {OPEN_CURLY} <br/>
            &emsp;&emsp;<span className="Comment">// View skills and interests</span><br/>
            &emsp;&emsp;<span className="Keyword">public</span> <span className="Keyword-2">String</span>[] <span className="Method-Class" onClick={() => navigate("/skills-and-interests")}>getSkillAndInterests</span>()<br/>
            &emsp;&emsp;<span className="Comment">// View projects</span><br/>
            &emsp;&emsp;<span className="Keyword">public</span> <span className="Keyword-2">String</span>[] <span className="Method-Class" onClick={() => navigate("/projects")}>getProjects</span>()<br/>
            &emsp;&emsp;<span className="Comment">// View resume</span><br/>
            &emsp;&emsp;<span className="Keyword">public</span> <span className="Keyword-2">File</span>     <span onClick={() => downloadResume()} className="Method-Class">getResume</span>()<br/>
            &emsp;&emsp;<span className="Comment">// View links</span><br/>
            &emsp;&emsp;<span className="Keyword">public</span> <span className="Keyword-2">String</span>[] <span className="Method-Class" onClick={() => navigate("/links")}>getLinks</span>()<br/>
            {CLOSE_CURLY}
        </div>
    );
}

export default Landing;
